        "findUs": MessageLookupByLibrary.simpleMessage("எங்களைத் தேடுங்கள்"),
        "forestEcoParkDescription": MessageLookupByLibrary.simpleMessage(
            "நீங்கள் சரியாக படித்தீர்கள்! Taman Eko Rimba Kuala Lumpur, ஆங்கிலத்தில் KL Forest Eco Park என அழைக்கப்படுகிறது, மலேசியாவின் மிகப் பழமையான காடுகளில் ஒன்றான ஹுட்டான் ஸிம்பான் புக்கிட் நானாசில் அமைந்துள்ளது. நீங்கள் உள்ளூர் ஆக இருந்தாலும் அல்லது வெளிநாட்டினர் ஆக இருந்தாலும், இது ஒரு பார்க்க வேண்டிய இடம் என்பதை நீங்கள் அறிந்திருப்பீர்கள்!"),
        "fraserHill":
            MessageLookupByLibrary.simpleMessage("பிரேசர் மலை, பஹாங்"),
        "fraserHillContent": MessageLookupByLibrary.simpleMessage(
            "பிரேசர் மலை, மலேசியாவின் மத்திய பகுதியான பஹாங் மாநிலத்தில் அமைந்துள்ளது. குளிர்ந்த விடுமுறை கேம்ப் இந்த தாவர அணுவியல் மற்றும் குளிர்ந்த சுழலால் பிரபலமாகும், இது மலேசியாவின் கடைசி மலை நிலையங்களில் ஒன்று, அங்கும் ஆங்கிலேயர் காலனிகளின் அடிச்சுவடு உள்ளது. புகிட் பிரேசர் பொதுவாக 1,200 மீ உயரம் கொண்டது, ஆனால் அதன் உயர்ந்த புள்ளி கடல்மட்டத்தில் 1,500 மீ உயரத்தில் உள்ளது. பகல் நேரத்தில் வெப்பநிலை 22°C முதல் 28°C வரை மாறும், இரவில் 16°C முதல் 20°C வரை இருக்கும்."),
