        "gentingHighlandsContent": MessageLookupByLibrary.simpleMessage(
            "குவாலா லம்பூரில் இருந்து 45 நிமிடங்கள் தொலைவில் உள்ள ஜெண்டிங் மலைகள், குளிர்ந்த மலைக்காற்றால் சூழப்பட்டுள்ள ஒரு மலை நிலையமாகும், 100 மில்லியன் ஆண்டுகள் பழமையான மழைக்காடுகளால் சூழப்பட்டுள்ளது. நகரத்தின் அவசரத்திலிருந்து வெளியேற விரும்பினால், ஜெண்டிங் மலைகளில் மூன்று மற்றும் ஐந்து நட்சத்திர ஹோட்டல்கள், உணவகங்கள், வசதிகள், சிறந்த சேவை மற்றும் மலை காட்சியுடன் பிரமாண்ட அறைகள் உள்ளன."),
