        "jalanAlorLocation": MessageLookupByLibrary.simpleMessage(
            "புக்கிட் பின்தாங், கோலாலம்பூர், மலேசிய மத்திய பிரதேசம்"),
        "jeramToi": MessageLookupByLibrary.simpleMessage(
            "ஜெராம் டொய், நெகிரி செம்பிலான்"),
        "jeramToiContent": MessageLookupByLibrary.simpleMessage(
            "ஜெராம் டொய் அருவிகள் செரம்பான் மற்றும் குவாலா கெலவாங்கின் மத்திய பகுதிக்கு அருகில் உள்ளன. இது 1985 ஆம் ஆண்டில் தொடங்கப்பட்டபோது தண்ணீர் ஊற்று மற்றும் குடும்ப பிக்னிக்கிற்கான பிரபலமான இடமாக மாறியது. ஜெராம் டொய்க்கு மாறுபட்ட நுழைவு வழி ஒன்று சாலைகளில் குறிப்பிட்டு உள்ளதாகவும் குறிப்பிட வேண்டும். இந்த பகுதி பரப்புகள், கழிப்பறைகள், பாறைகளில் மருந்துகள் மற்றும் தாங்கும் சிமென்ட் வழிகள் உள்ளன. வார இறுதியில் இங்கு களைகட்ட இருக்கும், ஆனால் வாரத்தின் மிச்ச நாட்களில் அமைதியாக இருக்கும்."),
        "jugraHill": MessageLookupByLibrary.simpleMessage("ஜுக்ரா மலை"),
        "jugraHillContent": MessageLookupByLibrary.simpleMessage(
            "ஜுக்ரா மலைக் குன்றில் இருக்கும் ஒளிவிளக்கத்தில் பறப்பயிற்சியின் சுவாரஸ்யத்தை அனுபவிக்கவும். காற்றின் நிலைமையைப் பொருத்தவரை, மார்ச் முதல் செப்டம்பர் வரை இதைச் செய்ய சிறந்த நேரமாக இருக்கும்."),
