        "parks": MessageLookupByLibrary.simpleMessage("கஃபே"),
        "kkbParaglidingParkContent": MessageLookupByLibrary.simpleMessage(
            "சாதனை உணர்வுள்ளவர்களுக்கு, குவாலா குபு பாரு சிறந்த தீவிர விளையாட்டுகளை வழங்குகிறது. நீங்கள் வானத்தில் பறக்கும் போது, குவாலா குபு பாருவின் சுற்றியுள்ள இயற்கையின் அற்புதங்களை கண்ணியமாகப் பார்வையிடும் வாய்ப்பு கிடைக்கும்."),
        "kl4Kids": MessageLookupByLibrary.simpleMessage("KV 4 குழந்தைகள்"),
        "klArtScene": MessageLookupByLibrary.simpleMessage("KL கலை நிலை"),
        "klAtAGlance":
            MessageLookupByLibrary.simpleMessage("கிளாங் பள்ளத்தாக்கைப் பற்றி"),
        "klDescription1": MessageLookupByLibrary.simpleMessage(
            "கிளாங் பள்ளத்தாக்கு மலேசியாவில் உள்ள ஒரு நகரப் பகுதியாகும், இது குவாலா லம்பூரை மையமாகக் கொண்டு, செலாங்கூர் மாநிலத்திலுள்ள சுற்றியுள்ள நகரங்களையும் கிராமங்களையும் உள்ளடக்கியது. இது கிரேட்டர் குவாலா லம்பூருடன் இணைக்கப்பட்டுள்ளது, ஆனால் இரண்டுக்கும் வேறுபாடுகள் உள்ளன."),
        "klDescription2": MessageLookupByLibrary.simpleMessage(
            "கிளாங் பள்ளத்தாக்கு, வடக்கு மற்றும் கிழக்கில் திதிவாங்சா மலைகள் மற்றும் மேற்கில் மலாக்கா நீரிணையால் உட்பட்டுள்ளது. இது வடமேற்கே ராவாங், தென்கிழக்கே செமென்யிஹ் மற்றும் தென்மேற்கே கிளாங் மற்றும் போர்ட் கிளாங் வரை பரவியுள்ளது. இந்த மாநகரப்பெருக்கம் மலேசியாவின் தொழில் மற்றும் வர்த்தக மையமாக உள்ளது."),
