            "இரும்பு காடு என்பது காமெரான் உயரநிலங்கள் மற்றும் மலேசியாவின் பிற மலைப்பகுதிகளில் மட்டுமே வளரக்கூடிய இயற்கை சுற்றுச்சூழல் அமைப்பாகும். காற்று மூலமாக அசையும் குறைந்த அளவிலான மேகங்கள் மரங்களை நீண்ட நிலைத்த பனியுடன் மூடுகின்றன, இது காய், பசும், லிச்சன் மற்றும் ஆர்கிட் போன்ற தாவரங்களுக்கு சிறந்த வாழிடமாக அமைக்கின்றது. இந்த ஈரமான அழகிய காடு பல வகையான மலைவாழ் உயிரினங்களுக்கு தஞ்சமாக உள்ளது, இதில் பட்டாம்பூச்சிகள், எலி வகைகள், தவளை வகைகள், பறவைகள் மற்றும் இதர விலங்குகள் உள்ளன."),
        "mountPulai": MessageLookupByLibrary.simpleMessage("புலை மலை, ஜோகூர்"),
        "mountPulaiContent": MessageLookupByLibrary.simpleMessage(
            "புலை மலை மலேசியா பினாங்கு பகுதியில் அமைந்துள்ள 654 மீட்டர் உயரம் கொண்ட மலை ஆகும். அதன் அண்மையில் இருக்கின்றதால், இந்த மலை சிங்கப்பூர் மற்றும் உள்ளூர் மக்களிடையே பிரபலமாக உள்ளது. மலை உச்சி பொதுமக்களுக்கு திறக்கப்படவில்லை, ஏனெனில் அதை இராணுவம் பாதுகாக்கின்றது மற்றும் இரண்டு தொடர்பு கோபுரங்களை கொண்டுள்ளது. புலை மலை 14.3 கிமீ நீளமுள்ள ஒரு சுற்றுப்பாதையாகும், இதில் ஒரு நீர்வீழ்ச்சி மற்றும் நடைபயணம் சவால் உள்ளது. இந்த பாதை முகாம், சைக்கிள் பயணம், ஓட்டம் மற்றும் இயற்கை நடையை அடைவதற்காகவும் பயன்படுத்தப்படுகிறது."),
        "mrtDescription": MessageLookupByLibrary.simpleMessage(
            "மேஸ் ரேபிட் டிரான்சிட் (MRT) இரண்டு கோடுகளாகப் பிரிக்கப்பட்டுள்ளது; முதல் கோடு சுங்கை புலோ-காஜாங் கோடு, இது 51 கிமீ நீளமுள்ளது, அதன் பாதையில் 31 நிலையங்கள் உள்ளன. அனைத்து நிலையங்களும் தினசரி காலை 6:00 மணிக்கு இயங்கத் தொடங்குகின்றன. மூடப்படும் நேரம் ஒவ்வொரு நிலையத்திற்கும் மாறுபடும். ஒரு பயணத்திற்கு RM1.20 மற்றும் அதற்கும் மேலாகக் கட்டணம் நிர்ணயிக்கப்பட்டுள்ளது. உதவி அழைப்பு: 1800-82-6868"),
