        "nightOutDescription": MessageLookupByLibrary.simpleMessage(
            "கோலாலம்பூர் ஒரு உயிரோட்டமான நகரம், அதற்குத் தனிப்பட்ட இரவு வாழ்க்கை உள்ளது. KL இன் இரவுக் காலத்தை அனுபவிக்க பாங்சார் அல்லது சாங்காட் புக்கிட் பின்டாங்கிற்கு செல்க. இங்கு உங்களுக்கு விருப்பமான பார்கள் மற்றும் DJக்கள் உள்ளனர், இந்த இடங்களில் தனிப்பட்ட பார்கள், இரவு முழுவதும் இசை வாசிப்பார்கள். தனிப்பட்ட உணவகங்கள், டிரெண்டி பார்கள் மற்றும் குளிர்ந்த கரோகே இடங்களும் உள்ளன, அனைவருக்கும் ஏதாவது இருக்கும்."),
