        "ozmosisSpaWebsite": MessageLookupByLibrary.simpleMessage(""),
        "pangkorIsland": MessageLookupByLibrary.simpleMessage("பங்கோர் தீவு"),
        "pangkorIslandContent": MessageLookupByLibrary.simpleMessage(
            "பங்கோர் தீவைப் பார்க்கலாம், சுற்றுலா பயணிகள் இல்லாத இடம் தேடினால். பேராக் கடற்கரைக்கு அருகில் அமைந்துள்ள இந்த தீவு வெறிச்சோடி காணப்படும் கடற்கரைகள், சுத்தமான நீர் மற்றும் நடுப்பகுதியை மறைக்கும் அடர்ந்த காடுகளை கொண்டுள்ளது. இந்த தீவில் மற்ற யாரும் இல்லாமல் பனைமரங்கள் கீழ் சூரிய குளியலுக்கான வாய்ப்பு கிடைக்கிறது. மேலும், ஒல்லாந்து காலனி கோட்டை மற்றும் பாரம்பரிய மரத் துறைமுகத்தில் புகைப்படம் எடுக்கவும்."),
        "panoramaHill":
            MessageLookupByLibrary.simpleMessage("பனோரமா மலை, சுங்கை லெம்பிங்"),
        "panoramaHillContent": MessageLookupByLibrary.simpleMessage(
            "பனோரமா மலை, சுங்கை லெம்பிங் பகுதியில், குவாண்டான் நகரின் 45 கி.மீ தொலைவில் உள்ளது. 271 மீட்டர் உயரம் கொண்ட இதற்கு ஒரே ஒரு பாதை உள்ளது. படிகளை தொடங்குங்கள், மேலே போகவும். பாதையின் முக்கிய அம்சம் படிகள் மற்றும் கைப்பிடிகள் கொண்டது; சில இடங்களில் மட்டுமே படிகள் இல்லை. உச்சியில் செல்லும்போது சுற்றியுள்ள நகரின் அழகான காட்சியை காணலாம். பயணிகள் பொதுவாக 30 முதல் 45 நிமிடங்களுக்கு மேலே செல்வர் பனோரமா மலைக்கான உச்சிக்கு செல்கின்றனர்."),
        "penangNationalPark": MessageLookupByLibrary.simpleMessage(
            "பினாங்கு தேசிய பூங்கா, பினாங்கு"),
        "penangNationalParkContent": MessageLookupByLibrary.simpleMessage(
            "மலேசியாவின் மிகச் சிறிய தேசிய பூங்காவாகும், 23 சதுர கி.மீ பரப்பளவைக் கொண்டது, ஆனால் அதன் கடற்கரைத் தொடரில் வெள்ளை இலைக் குரங்குகள், பறக்கும் லெமூர்கள், சீட்டுப் பூனைகள் மற்றும் பல வகையான பிறகு, உடலியல் உயிரினங்கள் மற்றும் ஊர்வன வகைகள் வாழ்கின்றன. இவ்வாறு மலையில் பயணிக்கவும், சுமூகமான தங்க மணல்வெளிப் பயணத்திற்குப் பக்கமாக உள்ள மரங்கள் மற்றும் கப்பல் பயணங்கள் ஆகியவற்றைச் சேர்க்கலாம். இதன் வழியாக நீங்கள் கடற்கரையின் பின்னர் செல்ல முடியும். இரண்டு முக்கிய பயண வழிகள் உள்ளன: ஒன்று கடற்கரைப் பக்கமாகவும், மற்றொன்று மலைகளைவிட்டு, தாமரைப்பூஜ்சம் செய்யக்கூடிய இடத்திற்குச் செல்லவும்."),
