        "pulauLangkawiContent": MessageLookupByLibrary.simpleMessage(
            "லங்காவி தீவு, மலேசியாவின் மலைகளும், மாங்க்ரோவ் காடுகளும் ஒளிரும் கடற்கரைகளுடன் இணைந்துள்ளது. யுனெஸ்கோவால் பட்டியலிடப்பட்ட புலாவு தயாங் புன்டிங் தீவுக்குச் சென்று, கழுக்களை உணவளித்து, குரங்குகள் உணவுக்காக நீந்துவதைக் காணலாம். அல்லது உங்கள் துாற்றியை எடுத்துச் சென்று பந்தாய் செனாங்கில் சூரிய குளியல் செய்து கடற்கரை பார் ஒன்றில் குடி விடுங்கள். கூடுதலாக, இந்த தீவு வரிவிலக்கு, அங்கே உங்கள் உள்ளகக் ஷாப்பிங் ஆதாயத்தை விடுங்கள்!"),
