            "ஏழு கிணறுகள் அருவி, Jalan Telaga Tujuh என்று அழைக்கப்படுகிறது, பிரபலமான லங்காவி ஸ்கை பாலத்தின் அருகில் சுமார் 20 நிமிடங்கள் நடக்கவும். இது இயற்கையின் காட்சிகளால் மகிழ்ச்சிகரமானது. மலை மேலிருந்து காசுயின் சிங்சாங், மகிழ்ச்சியடைந்தவர்கள் மற்றும் சுற்றுலாப் பிரயாணம் வந்தவர்களின் பிரபலமான இடமாகும். முழுக்க நீண்டு விழும் 91 மீட்டர் உயரம் உள்ள இடத்தின் மேல் அடிக்கிடன் காட்சிகள் கொண்டுள்ளது. மக்கள் நீரில் உள்ள சாந்தமான காற்றில் மேசை புராணக் கதைகளுக்கு அடுத்தடுத்ததாக பரிந்துறைகள் கொண்டுள்ளன."),
