        "sipadanIslandContent": MessageLookupByLibrary.simpleMessage(
            "சபாவின் செம்போர்னா அருகே உள்ள சிறிய தீவு உலகின் சிறந்த டைவிங் பகுதிகளில் ஒன்றாகக் கருதப்படுகிறது. தீவில் இடவசதி அல்லது பல வசதிகள் கிடையாது. உங்கள் பயணத்தின் போது ஒரு சுற்றுலா மேற்கொள்வது பரிந்துரைக்கப்படுகிறது. கோட்டா கினபாலுவில் இருந்து செம்போர்னா வரை பறக்கவும் மற்றும் ஒரு மணி நேர படகு பயணம் எடுத்துக் கொண்டு ஆமைகள் மற்றும் பாறக்குடா கூட்டங்களை காணலாம். 2002இல் பாதுகாக்கப்பட்ட நிலையைப் பெற்றபின், இந்த தளத்தை காணக்கூடிய சுற்றுலாப் பயணிகள் குறைவாகவே இருக்கிறார்கள்."),
