        "streetFood": MessageLookupByLibrary.simpleMessage("Malaysian"),
        "sultanAbdulSamadDescription": MessageLookupByLibrary.simpleMessage(
            "1897 ஆம் ஆண்டு கட்டப்பட்ட சுல்தான் அப்துல் சாமத் கட்டிடம், கோத்திக்கம், மேற்கு மற்றும் மூரிஷ் கட்டிடக் கலைகளை உள்ளடக்கியது..."),
        "sungaiLembing":
            MessageLookupByLibrary.simpleMessage("சுங்கை லெம்பிங், பஹாங்"),
        "sungaiLembingContent": MessageLookupByLibrary.simpleMessage(
            "மலேசியா பசுமையான நாடுகளில் ஒன்றாகும், இதில் பல பசுமையான இலைகளும், அற்புதமான அருவிகளும் காணப்படுகின்றன. ரெயின்போ அருவி குவாண்டன் என்றோ பக்கத்தில் 45 கி.மீ தொலைவில் உள்ள சுங்கை லெம்பிங் நகரத்தில் உள்ளது. ஒவ்வொரு நாளும் காலை 9 மணி முதல் 10 மணியளவில், கதிரவனின் ஒளி அருவியின் அடியில் விழ, சூரிய கதிரவுடன் அழகாக வெளிவரும். உலகில் பலர் இங்கு அற்புதமான இயற்கையை காண பல மணிநேரங்கள் பயணம் செய்கிறார்கள். சுங்கை லெம்பிங் அருவியின் ஆழமான சூழலைக் காண, ஃபோர்வீல் டிரைவ் வாகனம் மற்றும் ஹைக்கிங் பயணத்தை அனுமதிக்கின்றன."),
        "sungaiPisangContent": MessageLookupByLibrary.simpleMessage(
            "பிசாங் அருவி மலேசியாவின் செலாங்கோர் மாநிலம் கோம்பாக்கிற்கு அருகே அமைந்துள்ள 3.1 கி.மீ மெல்லிய பயண வழியில் அமைந்துள்ளது. இது அனைத்து திறன் நிலை கொண்ட பயணிகளுக்கும் ஏற்றது. இந்த வழி ஆண்டுதோறும் திறக்கப்பட்டு, அடிக்கடி கிம்பிங், சைக்கிள் ஓட்டுதல் மற்றும் பறவை பார்வைக்கு பயன்படுத்தப்படுகிறது. அருவியின் உச்சியில் சில சிறந்த பிக்னிக் மற்றும் முகாம் இடங்கள் உள்ளன. இந்த வழியில் நீங்கள் ஒரு அருவியைக் கடந்து செல்ல வேண்டும், எனவே நன்றாகக் களைச்சு செல்லும் பாதங்களை அணியவும்."),
